import styled from "styled-components";

export const StyledModalRegister = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  min-width: 100vw;
  min-height: 100vh;

  position: fixed;
  top: 0%;
  z-index: 4;

  background: rgba(0, 0, 0, 0.5);
`;
